import React from 'react'
import classes from  "./Footer.module.css";



const Footer = () => {
    return (
       <div className = {classes.container}>

           <h1 className = {classes.left}>Left</h1>
           <h1 className = {classes.right}>Right</h1>
       </div>
    )
}

export default Footer
